// AvgRating.jsx
import React from 'react';
import Nav from './Nav';
import AllEventsDetails from './AllEventsDetails';

const AvgRating = () => {
  return (
    <div>
      <Nav />
      <h2>All Events Details</h2>
      <AllEventsDetails />
    </div>
  );
};

export default AvgRating;
